/* convert form —> DB payload */ const toPayload = (d, userId)=>{
    const p = {
        user_id: userId,
        category_id: d.category_id || null,
        subcategory_id: d.subcategory_id || null,
        commercial_subcategory_id: d.commercial_subcategory_id || null,
        categoryName: d.categoryName || null
    };
    [
        "name",
        "manufacturer",
        "warranty",
        "price",
        "rating",
        "description",
        "long_description",
        "image",
        "pdfUrl",
        "catalogueUrl",
        "commercial_subcategory",
        "categoryName"
    ].forEach((k)=>{
        const val = d[k];
        if (val !== undefined && val !== "") p[k] = val;
    });
    p.is_featured = d.is_featured ?? false;
    p.features = explode(d.features_raw);
    p.applications = explode(d.applications_raw);
    p.benefits = explode(d.benefits_raw);
    p.installation = explode(d.installation_raw);
    p.relatedProducts = explode(d.related_raw);
    if (d.specifications_list?.length) {
        p.specifications = d.specifications_list.filter(({ key, value })=>key && value).map(({ key, value })=>({
                name: key.trim(),
                value: value.trim()
            }));
    }
    if (d.colours_list?.length) {
        p.colours = d.colours_list.filter(({ name })=>name).map(({ name, hex })=>({
                name: name.trim(),
                hex: hex?.trim() ?? undefined
            }));
    }
    if (d.images?.length) {
        p.images = d.images;
    }
    return p;
};
